CREATE SCHEMA IF NOT EXISTS prod;
DROP TABLE IF EXISTS prod."Aires marines protégées";
CREATE TABLE IF NOT EXISTS prod."Aires marines protégées" (
  id                 serial NOT NULL PRIMARY KEY,
  geom               geometry(MultiPolygon,4326),
  mpa_id             integer,
  mpa_pid            integer,
  gid                integer,  mpa_name           character varying,
  mpa_oriname        character varying,
  des_id             integer,
  des_desigfr        character varying,
  des_desigtype      character varying,
  mpa_status         character varying,
  mpa_datebegin      character varying,
  mpa_statusyr       integer,
  mpa_wdpaid         integer,
  mpa_wdpapid        character varying,
  mpa_mnhnid         character varying,
  mpa_marine         integer,
  mpa_calcarea       double precision,
  mpa_calcmarea      double precision,
  mpa_reparea        double precision,
  mpa_repmarea       double precision,
  mpa_url            character varying,
  mpa_updatewhen     character varying,
  iucn_idiucn        character varying,
  subloc_code        character varying,
  subloc_name        character varying,
  country_piso3      character varying,
  country_iso3       character varying,
  country_iso3namefr character varying,
  mpa_type           text,
  ref_reg            text,
  url_legicem        text
);

